const App = () => {

  const [input, setInput] = useState("")
  const [todos, setTodos] = useState([])
  return(
    <div>
      <div>
        <Headbar />
      </div>
      <div>
        <Form 
          input = {input}
          setInput = {setInput}
          todos = {todos}
          setTodos = {setTodos}
        />
      </div>
    </div>
  )
}
export default App
